import React from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableOpacity } from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { useTheme } from '../contexts/ThemeContext';
import { useLanguage } from '../contexts/LanguageContext';
import Header from '../components/Header';

const HelpCenterScreen = ({ navigation }) => {
  const { theme } = useTheme();
  const { t } = useLanguage();

  const helpTopics = [
    {
      id: 1,
      title: t('helpCenter.emergencyAlerts'),
      description: t('helpCenter.emergencyAlertsDesc'),
      icon: 'warning'
    },
    {
      id: 2,
      title: t('helpCenter.familyTracking'),
      description: t('helpCenter.familyTrackingDesc'),
      icon: 'people'
    },
    {
      id: 3,
      title: t('helpCenter.communityFeatures'),
      description: t('helpCenter.communityFeaturesDesc'),
      icon: 'chatbubbles'
    },
    {
      id: 4,
      title: t('helpCenter.mapUsage'),
      description: t('helpCenter.mapUsageDesc'),
      icon: 'map'
    },
    {
      id: 5,
      title: t('helpCenter.notifications'),
      description: t('helpCenter.notificationsDesc'),
      icon: 'notifications'
    },
    {
      id: 6,
      title: t('helpCenter.privacySettings'),
      description: t('helpCenter.privacySettingsDesc'),
      icon: 'shield-checkmark'
    }
  ];

  const renderHelpTopic = (topic) => (
    <TouchableOpacity
      key={topic.id}
      style={[styles.topicCard, { backgroundColor: theme.colors.cardBackground, borderColor: theme.colors.border }]}
      onPress={() => console.log(`Help topic selected: ${topic.title}`)}
    >
      <View style={styles.topicHeader}>
        <Ionicons
          name={topic.icon}
          size={24}
          color={theme.colors.primary}
          style={styles.topicIcon}
        />
        <Text style={[styles.topicTitle, { color: theme.colors.text }]}>
          {topic.title}
        </Text>
      </View>
      <Text style={[styles.topicDescription, { color: theme.colors.secondaryText }]}>
        {topic.description}
      </Text>
      <Ionicons
        name="chevron-forward"
        size={20}
        color={theme.colors.secondaryText}
        style={styles.chevron}
      />
    </TouchableOpacity>
  );

  return (
    <View style={[styles.container, { backgroundColor: theme.colors.background }]}>
      <Header
        title={t('helpCenter.title')}
        showBackButton={true}
        onBackPress={() => navigation.goBack()}
      />
      
      <ScrollView style={styles.content} showsVerticalScrollIndicator={false}>
        <View style={styles.header}>
          <Text style={[styles.welcomeText, { color: theme.colors.text }]}>
            {t('helpCenter.welcome')}
          </Text>
          <Text style={[styles.descriptionText, { color: theme.colors.secondaryText }]}>
            {t('helpCenter.description')}
          </Text>
        </View>

        <View style={styles.topicsContainer}>
          <Text style={[styles.sectionTitle, { color: theme.colors.text }]}>
            {t('helpCenter.frequentTopics')}
          </Text>
          {helpTopics.map(renderHelpTopic)}
        </View>

        <View style={styles.contactSection}>
          <Text style={[styles.sectionTitle, { color: theme.colors.text }]}>
            {t('helpCenter.contactUs')}
          </Text>
          
          <TouchableOpacity
            style={[styles.contactCard, { backgroundColor: theme.colors.cardBackground, borderColor: theme.colors.border }]}
            onPress={() => console.log('Email support pressed')}
          >
            <Ionicons name="mail" size={24} color={theme.colors.primary} />
            <View style={styles.contactInfo}>
              <Text style={[styles.contactTitle, { color: theme.colors.text }]}>
                {t('helpCenter.emailSupport')}
              </Text>
              <Text style={[styles.contactDescription, { color: theme.colors.secondaryText }]}>
                support@afet.net
              </Text>
            </View>
            <Ionicons name="chevron-forward" size={20} color={theme.colors.secondaryText} />
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.contactCard, { backgroundColor: theme.colors.cardBackground, borderColor: theme.colors.border }]}
            onPress={() => console.log('Phone support pressed')}
          >
            <Ionicons name="call" size={24} color={theme.colors.primary} />
            <View style={styles.contactInfo}>
              <Text style={[styles.contactTitle, { color: theme.colors.text }]}>
                {t('helpCenter.phoneSupport')}
              </Text>
              <Text style={[styles.contactDescription, { color: theme.colors.secondaryText }]}>
                +90 (212) 123 45 67
              </Text>
            </View>
            <Ionicons name="chevron-forward" size={20} color={theme.colors.secondaryText} />
          </TouchableOpacity>
        </View>
      </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  content: {
    flex: 1,
    paddingHorizontal: 20,
  },
  header: {
    paddingVertical: 20,
  },
  welcomeText: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 8,
  },
  descriptionText: {
    fontSize: 16,
    lineHeight: 24,
  },
  topicsContainer: {
    marginBottom: 30,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: '600',
    marginBottom: 16,
  },
  topicCard: {
    padding: 16,
    borderRadius: 12,
    borderWidth: 1,
    marginBottom: 12,
    position: 'relative',
  },
  topicHeader: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 8,
  },
  topicIcon: {
    marginRight: 12,
  },
  topicTitle: {
    fontSize: 16,
    fontWeight: '600',
    flex: 1,
  },
  topicDescription: {
    fontSize: 14,
    lineHeight: 20,
    marginLeft: 36,
    paddingRight: 30,
  },
  chevron: {
    position: 'absolute',
    right: 16,
    top: 16,
  },
  contactSection: {
    marginBottom: 30,
  },
  contactCard: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 16,
    borderRadius: 12,
    borderWidth: 1,
    marginBottom: 12,
  },
  contactInfo: {
    flex: 1,
    marginLeft: 12,
  },
  contactTitle: {
    fontSize: 16,
    fontWeight: '600',
    marginBottom: 4,
  },
  contactDescription: {
    fontSize: 14,
  },
});

export default HelpCenterScreen;
